8	\N	\N	Introduction de la fiche territoire	f	\N	territory-intro	\N	2020-03-28 22:24:19	2020-03-28 22:24:19	\N	f	<p>Dans les différents blocs ci-après, vous trouverez des informations de synthèse sur le territoire et sur sa <abbr title="Surface entourant le territoire en question selon une distance fixe. Ce n'est ni plus ni moins qu'un élargissement du territoire considéré, avec la même géométrie."> zone tampon</abbr>, selon une distance que vous pouvez définir dans l'encadré à droite. Il s'agit des connaissances disponibles qui peuvent s'avérer lacunaires.</p>\r\n\r\n<p>Le choix a été de mettre en avant les espèces présentant les statuts les plus défavorables.</p>
5	\N	Mentions légales	Mentions légales	f	\N	mentions-legales	\N	2020-03-28 22:24:19	2020-03-28 22:24:19	\N	t	<p><b>Propriétaire / Éditeur</b></p>\r\n<p>Le site biodiv-territoires.lpo-aura.org est un site web édité par l'association LPO Auvergne-Rhône-Alpes (Ligue pour la Protection des Oiseaux Auvergne-Rhône-Alpes). L'ensemble du site biodiv-territoires.lpo-aura.org, pages et contenus, est la propriété de la LPO Auvergne-Rhône-Alpes.</p>\r\n\r\n<p>LPO (Ligue pour la Protection des Oiseaux) Auvergne-Rhône-Alpes</p>\r\n<p>Association sous le numéro SIRET 301 125 100 00034</p>\r\n\r\n<p>Siège social: Maison de l'environnement - 14, Avenue Tony Garnier 69007 Lyon</p>\r\n<p>Téléphone :  04 37 61 05 06</p>\r\n<p>Courriel : auvergne-rhone-alpes[at]lpo.fr</p>\r\n\r\n<p><b>Hébergeur</p></b>\r\n\r\n<p>Le serveur de la LPO Auvergne-Rhône-Alpes est hébergé par SCALEWAY SAS BP 438 75366 PARIS CEDEX 08</p>\r\n<p>Siège social : 8 rue de la Ville l’Evêque, 75008 Paris</p>\r\n<p>Téléphone : 01 84 13 00 00</p>\r\n\r\n<p>La LPO Auvergne-Rhône-Alpes décline toute responsabilité quant aux éventuelles interruptions du site biodiv-territoires.lpo-aura.org et de ses services.</p>\r\n\r\n\r\n<p><b>Concepteur / Créateur</p></b>\r\n\r\n<p>Le site biodiv-territoires.lpo-aura.org a été créé par la LPO Auvergne-Rhône-Alpes. Le code source est disponible sur <a href="https://github.com/lpoaura/GeoNature-BiodivTerritoires" target="_blank">Github</a>.</p>\r\n\r\n\r\n<p><b>Contenus et droits de reproduction</p></b>\r\n\r\n<p>En application des articles L. 111-1 et L. 123-1 du Code de la Propriété Intellectuelle, l'ensemble des contenus de ce site (textes, images, vidéos et tout média en général), sauf mention contraire explicite, est protégé par le droit d'auteur. La reproduction, même partielle, des contenus des pages de ce site sans accord préalable de la LPO Auvergne-Rhône-Alpes (Ligue pour la Protection des Oiseaux Auvergne-Rhône-Alpes) est strictement interdite.\r\n© Copyright LPO Auvergne-Rhône-Alpes (Ligue pour la Protection des Oiseaux) | Tous droits réservés.</p>\r\n\r\n<p><b>Conditions d'utilisation</p></b>\r\n<p><b>ACCEPTATION DE FAIT</b></p>\r\n\r\n<p>En utilisant le site biodiv-territoires.lpo-aura.org, l'internaute prend note et accepte les conditions ici énumérées.</p>\r\n\r\n<p><b>ABUS</b></p>\r\n\r\n<p>En application de la loi n° 2004-575 du 21 juin 2004 pour la confiance dans l'économie numérique, pour signaler un contenu litigieux ou si vous êtes victime d'une utilisation frauduleuse du site biodiv-territoires.lpo-aura.org, merci de contacter l'administrateur du site à l'adresse courriel : auvergne-rhone-alpes@lpo.Fr</p>\r\n\r\n<p><b>COLLECTE ET TRAITEMENT DE DONNÉES PERSONNELLES</b></p>\r\n\r\n<p>Les informations éventuellement recueillies par le site biodiv-territoires.lpo-aura.org ne sont jamais communiquées à des tiers. Sauf cas particulier, ces informations proviennent de l'enregistrement volontaire d'une adresse courriel fournie par l'internaute, lui permettant de recevoir une documentation ou une newsletter, de demander son inscription dans le comité rédactionnel du site ou de se renseigner sur un point quelconque.</p>\r\n\r\n<p>En application de la loi n° 78-17 du 6 janvier 1978 relative à l'informatique, aux fichiers et aux libertés, l'internaute dispose d'un droit d'accès, de rectification et de suppression des informations personnelles le concernant stockées par le site biodiv-territoires.lpo-aura.org, qu'il peut exercer à tout moment auprès de l'administrateur du site biodiv-territoires.lpo-aura.org. Pour une demande de ce type, veuillez adresser un courrier à la LPO Auvergne-Rhône-Alpes ou contacter l'adresse courriel : auvergne-rhone-alpes[@]lpo.fr.</p>\r\n\r\n<p><b>COOKIES</b></p>\r\n\r\n<p>Certaines informations nominatives et certains marqueurs témoins peuvent être enregistrés par le site biodiv-territoires.lpo-aura.org sur l'ordinateur personnel de l'internaute sans expression de la volonté de ce dernier ("cookies"). Sauf indication contraire explicite, ces procédés techniques ne sont pas indispensables au bon fonctionnement du site biodiv-territoires.lpo-aura.org et leur utilisation peut bien entendu être désactivée dans le navigateur utilisé par l'internaute sans que sa navigation en soit affectée. Aucune de ces informations n'est conservée par le site après déconnexion de l'internaute.</p>\r\n\r\n<p><b>LIMITATION DE RESPONSABILITÉ</b></p>\r\n\r\n<p>Le site biodiv-territoires.lpo-aura.org comporte des informations mises à disposition par des sociétés externes ou des liens hypertextes vers d'autres sites ou d'autres sources externes qui n'ont pas été développés par la LPO Auvergne-Rhône-Alpes. Les comportements des sites cibles, éventuellement malveillants, ne sauraient être rattachés à la responsabilité du site biodiv-territoires.lpo-aura.org. Plus généralement, le contenu mis à disposition sur ce site est fourni à titre informatif. Il appartient à l'internaute d'utiliser ces informations avec discernement. La responsabilité de la LPO Auvergne-Rhône-Alpes ne saurait être engagée de fait quant aux informations, opinions et recommandations formulées par des tiers.</p>\r\n\r\n<p>Dans la mesure où la LPO Auvergne-Rhône-Alpes ne peut contrôler ces sites ou sources externes, elle ne peut être tenue pour responsable de la mise à disposition de ces sites ou sources externes et ne peut supporter aucune responsabilité quant aux contenus, publicités, produits, services ou tout autre matériel disponible sur ou à partir de ces sites ou sources externes. De plus, la LPO Auvergne-Rhône-Alpes ne pourra être tenue responsable de tous dommages ou pertes avérés ou allégués consécutifs ou en relation avec l'utilisation ou le fait d'avoir fait confiance au contenu, à des biens ou des services disponibles sur ces sites ou sources externes.</p>
