6	\N	Partenaires financiers	Partenaires financiers	f	\N	financial_partners	\N	2020-03-28 22:24:19	2020-03-28 22:24:19	\N	f	<p>Cette plateforme a &eacute;t&eacute; d&eacute;velopp&eacute;e par la <a href="https://auvergne-rhone-alpes.lpo.fr/" target="_blank">LPO Auvergne-Rhône-Alpes</a> gr&acirc;ce au soutien financier de la <a href="https://www.auvergnerhonealpes.fr/" target="_blank">R&eacute;gion Auvergne-Rh&ocirc;ne-Alpes</a>, de la <a href="http://www.auvergne-rhone-alpes.developpement-durable.gouv.fr/" target="_blank">DREAL Auvergne-Rh&ocirc;ne-Alpes</a> et sur fonds propres.</p>\r\n<div class="container" style="border-radius: 5px; color: var(--dark);">\r\n<p class="text-center">\r\n  <img alt="Logo de la Région Auvergne-Rhône-Alpes" src="https://aura-partage.lpo.fr/img/Logo-Region-Gris-pastille-Bleue-EPS-RVB.svg" style="height:150px; width:301px" />&nbsp;\r\n  &nbsp;<img alt="Logo de la DREAL Auvergne-Rhône-Alpes" src="https://aura-partage.lpo.fr/img/blocmarque_pref_region_auvergne_rhone_alpes.svg" style="height:150px; width:301px" />&nbsp;\r\n  &nbsp;<img alt="Logo de la LPO Auvergne-Rhône-Alpes" src="https://aura-partage.lpo.fr/img/logo_lpo_aura.svg" style="height:150px; width:301px" /></p>\r\n</div>
11	\N	A propos de cette plateforme	Description de la plateforme	f	\N	home_desc	\N	2021-04-07 10:05:47	2021-04-07 10:05:47	\N	f	<p>Elle a pour objectifs de diffuser les enjeux de biodiversit&eacute; &agrave; l&#39;&eacute;chelle des territoires communaux et intercommunaux afin de favoriser leur prise en compte dans les diff&eacute;rents projets.</p>\r\n\r\n<p>L&#39;emprise g&eacute;ographique est celle de la r&eacute;gion Auvergne-Rh&ocirc;ne-Alpes.</p>\r\n\r\n<p>Initialement d&eacute;velopp&eacute;e pour restituer les donn&eacute;es de la <a href="https://auvergne-rhone-alpes.lpo.fr" target="_blank">LPO</a>, elle va int&eacute;grer l'<a href="https://www.biodiversite-auvergne-rhone-alpes.fr/" target="_blank">Observatoire R&eacute;gional de la Biodiversit&eacute;</a>   et restituer toutes les donn&eacute;es publiques de la r&eacute;gion.</p>
13	\N	Partenaires techniques	Partenaires techniques	f	\N	technical_partners	\N	2021-04-07 10:06:36	2021-04-07 10:06:36	\N	f	<p class="text-center">Cette plateforme valorise les données produites par la LPO, auxquelles viennent s'ajouter les donn&eacute;es que son r&eacute;seau de partenaires met &agrave; sa disposition. Pour les structures d'ordre régional, les principaux partenaires de la LPO sont le <a href="http://mammiferes.org/" target="_blank">Groupe Mammalogique d'Auvergne</a>, <a href="https://www.chauve-souris-auvergne.fr/" target="_blank"> Chauve-Souris Auvergne</a>, l'<a href="https://observatoirereptilesauvergne.wordpress.com/" target="_blank">Observatoire des Reptiles d'Auvergne</a>, ou encore le <a href="http://www.sympetrum.fr/" target="_blank">Groupe Sympetrum</a>.</p>\r\n\r\n
2	\N	A propos	A propos	t	1	about	\N	2020-03-28 22:24:19	2020-03-28 22:24:19	\N	t	<p>Cette plateforme a été d&eacute;velopp&eacute;e par la LPO Auvergne-Rh&ocirc;ne-Alpes gr&acirc;ce au soutien financier de la R&eacute;gion Auvergne-Rh&ocirc;ne-Alpes, de la DREAL Auvergne-Rh&ocirc;ne-Alpes et sur fonds propres.</p>\r\n\r\n<p>Elle a pour objectifs de diffuser les enjeux de biodiversit&eacute; &agrave; l&#39;&eacute;chelle des territoires communaux afin de favoriser leur prise en compte dans les diff&eacute;rents projets. L&#39;emprise g&eacute;ographique est celle de la r&eacute;gion Auvergne-Rh&ocirc;ne-Alpes.</p>\r\n\r\n<p>Actuellement, sont restitu&eacute;es les connaissances disponibles dans les bases de donn&eacute;es de la LPO Auverge-Rh&ocirc;ne-Alpes. Elles proviennent de la LPO mais aussi de structures partenaires dont la liste sera prochainement publi&eacute;e. Par ailleurs, des d&eacute;veloppements compl&eacute;mentaires seront r&eacute;alis&eacute;s et des partenariats mis en place de mani&egrave;re &agrave; restituer d&#39;autres jeux de donn&eacute;es et d&#39;autres enjeux de biodiversit&eacute;.</p>\r\n\r\n<p class="text-center">\r\n  <img alt="Logo de la Région Auvergne-Rhône-Alpes" src="https://aura-partage.lpo.fr/img/Logo-Region-Gris-pastille-Bleue-EPS-RVB.svg" style="height:150px; width:301px" />&nbsp;\r\n  &nbsp;<img alt="Logo de la DREAL Auvergne-Rhône-Alpes" src="https://aura-partage.lpo.fr/img/blocmarque_pref_region_auvergne_rhone_alpes.svg" style="height:150px; width:301px" />&nbsp;\r\n  &nbsp;<img alt="Logo de la LPO Auvergne-Rhône-Alpes" src="https://aura-partage.lpo.fr/img/logo_lpo_aura.svg" style="height:150px; width:301px" /></p>
